import React from 'react';
import './App.css';

interface LinkedInProps {
  hasLinkedIn: boolean,
  linkedInLink: string
}

interface GithubProps {
  hasGithub: boolean,
  githubLink: string
}

interface DisplayProps {
  name: string,
  hasLinkedIn: boolean,
  hasGithub: boolean,
  linkedInLink: string,
  githubLink: string
}

class DevInfo {
  name: string;
  hasLinkedIn: boolean;
  hasGithub: boolean;
  linkedInLink: string;
  githubLink: string;

  constructor(name: string, hasLinkedIn: boolean, hasGithub: boolean, linkedInLink: string, githubLink: string){
    this.name = name;
    this.hasLinkedIn = hasLinkedIn;
    this.hasGithub = hasGithub;
    this.linkedInLink = linkedInLink;
    this.githubLink = githubLink;
  } 
}

const GithubPreview = ({hasGithub, githubLink}: GithubProps ) => {
  if (hasGithub) {
    return (
      <div className="github">
        <a href={githubLink}><img src="my-app/public/media/github logo.png" alt="Github" /></a>
      </div>
    )
  }
  else {
    return <div></div>;
  }
}

const LinkedInPreview = ({hasLinkedIn, linkedInLink}: LinkedInProps) => {
  if (hasLinkedIn) {
    return (
      <div className="github">
        <a href={linkedInLink}><img src="my-app/public/media/linkedIn logo.png" alt="linkedIn" /></a>
      </div>
    )
  }
  else {
    return <div></div>;
  }
}

const DisplayInfo = ({ name, hasLinkedIn, hasGithub, linkedInLink, githubLink }: DisplayProps) => {
  return (
    <div>
      <h3>{{ name }}</h3>
      <div>
        <LinkedInPreview hasLinkedIn={(hasLinkedIn)} linkedInLink={linkedInLink} />
        <GithubPreview hasGithub={hasGithub} githubLink={githubLink} />
      </div>
    </div>
  );
}

const NavBar = () => {

  return (
    <nav>
      <div>Easy</div>
      <div>Medium</div>
      <div>Hard</div>
    </nav>
  )
}

let bryan = new DevInfo("Bryan",true ,true,"https://linkedin.com/in/bryang229","https://github.com/bryang229");


function App() {
  return (
    <div>
      <h1>Chose your difficulity</h1>
      <br />
      <div className="App">
        <NavBar />
      </div>
      <footer>
        <h3>Ð¯O|OR</h3>
        <div id="about">
          <DisplayInfo name={"Bryan"} hasGithub={true} hasLinkedIn={true} linkedInLink={"https://linkedin.com/in/bryang229"} githubLink={"https://github.com/bryang229"}/>
          </div>
      </footer>
    </div>
  );
}

export default App;
